import React from 'react';

const styles = {
  wrapper: {
    background: '#2e81f1',
    background: '-webkit-radial-gradient(circle, #3088f2, #2e81f1)',
    background: 'radial-gradient(circle, #3088f2, #2e81f1)',
    borderBottomRightRadius: 40,
    padding: 30,
    color: '#fff'
  }
};

export default function HeaderWrapper(props) {
  return <div style={styles.wrapper}>{props.children}</div>;
}
